window.bookSummaryJSON = "<p>Actions have consequences, and my actions are about to kick me in the teeth. </p> <p>I’m still reeling from the unthinkable. Lucas is gone. It’s all my fault and if the dominus can’t find evidence that my actions were under duress then the consequences will be lethal.</p> <p>Sanctuary lies with Grayson and his pack, but I’m a rare commodity - a female loup in a world where females are rare - and the other packs aren’t going to back off without a fight. Even if I escape the executioner’s noose, the loup world isn’t about to let me go so easily.</p> <p>This time there is no hiding. This time there is no get out of jail free card. The loup world is about to swallow me whole, and I'm not sure I'll make it out alive.</p> <p>A kickass urban fantasy with a why choose romance. Vampires, ghosts, angels, and demons. Perfect for listeners who enjoy forbidden romance, enemies to lovers, or friends to lovers.</p>"; 
